import Tabs from "react-bootstrap/Tabs";
import Tab from "react-bootstrap/Tab";
import { Row } from "react-bootstrap";

import CommentBody from "./CommentBody";
import VideoShop from "../Shop/VideoShop";
import RelatedVideo from "./RelatedVideo";

const CommentBox = (props) => {
	return (
		<>
			<div className="box  single-video-comment-tabs" >
				<Tabs defaultActiveKey="vidoe" >
					<Tab eventKey="vidoe" title="1">
					
					<div className="video-block section-padding">
						<Row>
                        
                  <VideoShop id={props.id} />
								
						</Row>
					</div>
					</Tab>
					<Tab eventKey="disqus" title="2">
					 <RelatedVideo/>
					</Tab>
					<Tab eventKey="fb" title="others">
						<CommentBody />
					</Tab>
				</Tabs>
			</div>
		</>
	);
};

function Soon() {
	return <p>Coming Soon...</p>;
}

export default CommentBox;
